import React from "react";
import { motion } from "framer-motion";

function ZakLogo() {
  return (
    <>
      <div style={{ height: "100px" }}>
        <motion.div
          initial={{
            opacity: 0,
          }}
          animate={{ opacity: 1 }}
          transition={{ duration: 2.4 }}
        >
          <h1>زكريا رب</h1>
          <h3>Zakaria Rab</h3>
        </motion.div>
      </div>
    </>
  );
}

export default ZakLogo;
